import React from 'react';

function Hero() {
  return (
    <section className="hero">
      <h1>Innovating the Future with Intelligence and Precision</h1>
      <p>At Inventra Labs, we build cutting-edge software solutions and empower businesses with smart technology.</p>
      <div className="hero-buttons">
        <button>Explore Products</button>
        <button>Partner with Us</button>
      </div>
    </section>
  );
}

export default Hero;
